head.script:
scwin.onpageload = function() {
	dl_result.setJSON(dl_hcode2.getAllJSON());
};

function searchHcode() {
    let keyword = ipt_hcode2.getValue().trim().toUpperCase();

    dl_hcode2.setColumnFilter(
        {
            type: 'row',
            colIndex: 'code',
            key: keyword,
            condition: 'and',
            exactMatch: false
        }
    );

    let result1 = dl_hcode2.getAllFilteredJSON();

    dl_hcode2.setColumnFilter(
        {
            type: 'row',
            colIndex: 'des',
            key: keyword,
            condition: 'or',
            exactMatch: false
        }
    );

    let merged = mergeUniqueRows(result1, dl_hcode2.getAllFilteredJSON());

    dl_result.setJSON(merged);
}

scwin.btn_search_onclick = function (e) {
    searchHcode();
};

scwin.ipt_hcode1_onkeydown = function (e) {
    if (e.key === "Enter") {
        searchHcode();
    } 
};

scwin.btn_close_onclick = function (e) {
    localStorage.removeItem("hcode2");
    $p.closePopup("mf_hcode_popup");
};

scwin.btn_confirm_onclick = function (e) {
    $p.parent().ipt_hcode2.setValue(localStorage.getItem("hcode2"));
    localStorage.removeItem("hcode2");
    $p.closePopup("mf_hcode_popup");
};

scwin.grd_result_oncellclick = function (rowIndex, columnIndex, columnId) {
    localStorage.setItem("hcode2", grd_result.getRowData(rowIndex)[0]);
};
